import React from 'react';
import '..styles/help.css';
import Selector from '../components/UI/Selector';

function Help() {
  return (
    <div id='Main'>
      <div className='helpTop'>
        <div>고객센터</div>
        <div>
        <Selector content='FAQ'/>
        <Selector content='공지사항'/>
        <Selector content='1대1 문의'/>
        </div>
      </div>
    </div>
  );
}

export default Help;
